import React from "react";
import { Link } from "react-router-dom";
import "./BodyCream.css";
import test from "../Image/ImageData";

const urls = [
  "/src/Image/bodycream1.jpg",
  "/src/Image/bodycream2.jpg",
  "/src/Image/bodycream3.jpg"
];

class BodyCream extends React.Component {
  state = {
    urls: test
  };
  renderImage(imageUrl) {
    return (
      <div>
        {console.log(imageUrl)}
        <img src={imageUrl} />
      </div>
    );
  }
  render() {
    console.log(this.state.urls.adata.initialdata);
    return (
      <>
        <Link to="/">Go Home</Link>
        <div className="gallery">
          <div className="images">
          {this.state.urls.adata.initialdata.map(image => this.renderImage(image))}
          </div>
        </div>
      </>
    );
  }
}

export default BodyCream;
